const LogFilter = (props) => {
  const currentYear = new Date().getFullYear();
  return (
    <div>
      年份：
      <select value={props.year}>
        <option value={currentYear}>2024</option>
        <option value={currentYear - 1}>2023</option>
        <option value={currentYear - 2}>2022</option>
        <option value={currentYear - 3}>2021</option>
      </select>
    </div>
  );
};
export default LogFilter;
